} from "shards-react";

class SubmitStory extends React.Component {
  constructor(props) {
    super(props);

    this.state = {};
  }
  render() {
    return (
      <Card>
        <CardBody>
          <CardTitle>...</CardTitle>
        </CardBody>
      </Card>
    );
  }
}

export default SubmitStory;
